@keyframes skeleton {
  0% {
    transform: scaleX(0);
    transform-origin: left center;
    opacity: 0.3;
  }

  20% {
    transform: scaleX(1);
    transform-origin: left center;
    opacity: 1;
  }

  28% {
    transform: scaleX(1);
    transform-origin: right center;
  }

  51% {
    transform: scaleX(0);
    transform-origin: right center;
  }

  58% {
    transform: scaleX(0);
    transform-origin: right center;
  }

  82% {
    transform: scaleX(1);
    transform-origin: right center;
  }

  83% {
    transform: scaleX(1);
    transform-origin: left center;
  }

  96% {
    transform: scaleX(0);
    transform-origin: left center;
  }

  100% {
    transform: scaleX(0);
    transform-origin: left center;
    opacity: 0.3;
  }
}

